import React from 'react';


export default props => {

    const {info} = props;

    return(
        <div className="looks">
            <h2>Product List: </h2>

                {
                    info.map((item, i) =>
                    <p key={i}> {item.title}</p>
                    )
                }

        </div>
    )


}
